import React from 'react';
import { NavLink } from 'react-router-dom';


const Home = () => {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-12 home">
                    <nav>
                        <ul>
                            <li><NavLink></NavLink></li>
                        </ul>
                    </nav>

                </div>
            </div>
        </div>
    );
}

export default Home;
